package com.migibert.kheo.core.plugin.logo;

import java.util.List;

import jersey.repackaged.com.google.common.collect.Lists;

import com.migibert.kheo.core.AbstractSshCommand;

public class LogoPngCommand extends AbstractSshCommand<List<LogoPngServerProperty>> {
	public LogoPngCommand() {
		super("");
	}

	@Override
	public List<LogoPngServerProperty> parse(String result) {
		LogoImagePngServerProperty p = new LogoImagePngServerProperty();
		p.encodedImage = "";
		
		DescriptionLogoPngServerProperty d = new DescriptionLogoPngServerProperty();
		d.description = "logo";
		return Lists.newArrayList(p, d);
	}
}
